{
  return(
    <div >
    <h1> Our <span className="code">Packages</span> </h1>
    <div className="flex flex-wrap justify-center">
        <div className="ma2">
        <div class="px-2 py-6 mx-auto lg:w-1/4 md:w-full">
            <div class="m-2 border rounded-xl">
             <h3 class="mb-3 text-lg font-bold text-blue-700 lg:text-4xl title-font code">DOMAIN+WEBSITE(STATIC)
